import ReactDOM from "react-dom";
import React, { Component } from "react";

export default class Column extends Component<{
  width?: number,
  right?: boolean,
  children?: React.Node
}> {
  render() {
    return (
      <div
        className={
          "col w-" +
          (this.props.width ? "-" + this.props.width : "") +
          (this.props.right ? " text-right" : "")
        }
      >
        {this.props.children}
      </div>
    );
  }
}
